export default function Element({rank, icon, name, symbol, priceUsd}){
    return(
        <div className="each">
            <p className="rank">{rank}</p>
            <div>{icon}</div>
            <p>{name}/{symbol}</p>
            <p>{priceUsd}</p>
        </div>
    )
}
